import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      techbros: []
    };
  }

  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/users')
    .then(response => response.json())
    .then(users => this.setState({techbros: users}))
  }

  render() {
    return (
      <div className='App'> 
        <h2>Tech Bro Names: </h2>
        {
          this.state.techbros.map(techbro => (
            <h1 key={techbro.id}>{techbro.name}</h1>
          ))
        }

      </div>
    );
  }
}
export default App;
